import { Routes, Route, Navigate } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import LoginPage from "../pages/LoginPage";

const PrivateRoute = ({ children, ...rest }) => {
    const navigate = useNavigate();
    const isAuthenticated = false; // Zamijenite ovu vrijednost s vašom provjerom autentifikacije

    if (!isAuthenticated) {
        // Koristite useEffect ili izravni poziv unutar nekog događaja za navigaciju
        navigate('/login');
    }

    return (
        <Routes>
            {isAuthenticated ? (
                <Route {...rest}>{children}</Route>
            ) : (
                <Navigate to="/login" />
            )}
        </Routes>
    );
};

export default PrivateRoute;
